import React, { useState } from "react";

const Timer = () => {
    const [massage, setMassage] = useState("Phong");
    return (
        <div
            type="text"
            value={massage}
            onChange={(e) => setMassage(e.target)}
        ></div>
    );
};

export default Timer;
